  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes Delmarva fox squirrel
  population performance between January 1991 and May 1998 on seven benchmark study
  sites: Blackwater National Wildlife Refuge, Chincoteague National Wildlife Refuge,
  Hayes Farm, Lecompte Wildlife Management Area, Wye Island Natural Resource Management
  Area, Prime Hook National Wildlife Refuge and Assawoman Wildlife Management Area.
  The analysis in this report (1) provides a summary and comparison between sites
  for basic sampling data such as the number of captures recorded per year and the
  number of individuals observed; (2) compares the apparent efficacy of different
  sampling procedures; (3) provides statistical comparisons of Delmarva Fox Squirrel
  abundance between sites through time and between study areas on Blackwater and Chincoteague;
  (4) examines the statistical relationship between squirrel abundance in adjacent
  years; and (5)  examines the statistical relationship between Delmarva Fox Squirrel
  abundance and the abundance of other, sympatric squirrel species.\",\n\t\"owner_org\":
